import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";
import CookieConsent from "react-cookie-consent";

import MediaPlayer from './components/MainComponents/MediaPlayer';
import Header from './components/MainComponents/Header';
import LoginForm from './components/Dialogs/LoginForm';
import RegistrationForm from './components/Dialogs/RegistrationForm';
import PrivateRoute from './utils/PrivateRoute';

const App = () => {
  return (
    <main className="container">
      <Router>
        <div className="row justify-content-md-center">
          <Header />
        </div>
        <Switch>
          <div className="row justify-content-md-center">
            <Route path="/register">
              <RegistrationForm />
            </Route>
            <Route path="/login">
              <LoginForm />
            </Route>
            <PrivateRoute path="/">
              <div className="row bg-light">
                <div className="col-md-12">
                  <MusicCollection updateCurrentSong={updateCurrentSong} />
                </div>
                <div className="col-md-12">
                  {currentSongID && (<Player
                    currentSongName={currentSongName}
                    currentSongID={currentSongID}
                  />)}
                </div>
              </div>
            </PrivateRoute>



            <MediaPlayer className="MediaPlayer" />
          </div>
        </Switch>
      </Router>
      <CookieConsent>This site uses cookies.</CookieConsent>
    </main >
  )
}

export default App;
